//image sources
var _1 = "data:image/png;base64,";
var _2 = "data:image/png;base64,"

//create the actual image
var image = document.createElement("img");
document.body.appendChild(image);
image.style = "position:fixed;top:-10%;z-index:9999; pointer-events:none;width:100%";
image.current = 1;
image.src = _1;
window.image = image;

//switch between them
document.body.addEventListener("keydown", function(e){
   if(e.key == "z") {
     switch (image.current) {
         case 1:
             image.current = 2;
             image.src = _2;
             break;
         case 2:
             image.current = 1;
             image.src = _1;
             break;
     }
   }
});

//first option activated by 7

var canvas = document.createElement("canvas");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
canvas.style.position = "fixed";
canvas.style.top = "0";
canvas.style.left = "0";
canvas.style.pointerEvents = "none";
canvas.style.zIndex = "9999";
document.body.appendChild(canvas);

var isCanvasOn = true;

function toggleCanvas() {
  if (isCanvasOn) {
    canvas.style.display = "none";
    isCanvasOn = false;
  } else {
    canvas.style.display = "block";
    isCanvasOn = true;
  }
}

var ctx = canvas.getContext("2d");
ctx.strokeStyle = "#fff";
ctx.lineWidth = 2;
ctx.beginPath();
ctx.moveTo(window.innerWidth / 2 - 10, window.innerHeight / 2);
ctx.lineTo(window.innerWidth / 2 + 10, window.innerHeight / 2);
ctx.moveTo(window.innerWidth / 2, window.innerHeight / 2 - 10);
ctx.lineTo(window.innerWidth / 2, window.innerHeight / 2 + 10);
ctx.stroke();

document.addEventListener("keydown", function(event) {
  if (event.keyCode === 55) { // 7 key
    toggleCanvas();
  }
});

//second option activated by 8

var canvas = document.createElement("canvas");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
canvas.style.position = "fixed";
canvas.style.top = "0";
canvas.style.left = "0";
canvas.style.pointerEvents = "none";
canvas.style.zIndex = "9999";
document.body.appendChild(canvas);

var ctx = canvas.getContext("2d");
ctx.lineWidth = 2;

var hue = 0;
var isOn = false;

function cycleColors() {
  hue += 1;
  ctx.strokeStyle = "hsl(" + hue + ", 100%, 50%)";
  ctx.beginPath();
  ctx.moveTo(window.innerWidth / 2 - 10, window.innerHeight / 2);
  ctx.lineTo(window.innerWidth / 2 + 10, window.innerHeight / 2);
  ctx.moveTo(window.innerWidth / 2, window.innerHeight / 2 - 10);
  ctx.lineTo(window.innerWidth / 2, window.innerHeight / 2 + 10);
  ctx.stroke();
}

function toggleCrosshair() {
  if (!isOn) {
    isOn = true;
    cycleColors();
    interval = setInterval(cycleColors, 10);
  } else {
    isOn = false;
    clearInterval(interval);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
  }
}

document.addEventListener("keydown", function(event) {
  if (event.key === "8") {
    toggleCrosshair();
  }
});
